    <script>
        if ('serviceWorker' in navigator) {
        if (Number(window.localStorage.getItem('ChuckleSet')) < 1) {
          (async()=>{window.stop()})()
          window.localStorage.setItem('ChuckleSet', 1)
        }
        navigator.serviceWorker.register('/giggles.js')
          .then(async () => {
            if (Number(window.localStorage.getItem('ChuckleSet')) < 2) {
              window.localStorage.setItem('ChuckleSet', 2)
              setTimeout(() => {
                window.location.reload()
              }, 150)
            }
          })
        }
    </script>
